let parse_ship = function(ship) {
  try {
    return JSON.parse(ship);
  } catch (e) {}
};

let tier7 = {};

for (let ship of ships) {
  ship = parse_ship(ship);
  if (ship) {
    let {level, model} = ship.typespec;
    if (level === 7) {
      tier7[700 + model] = true;
    }
  }
}

this.tick = function (game) {
  if (game.step % 15 === 0) {
    for (let ship of game.ships) {
      if (ship.stats == 0 && tier7[ship.type]) {
        ship.set({stats: 10000000});
      }
    }
  }
};

this.event = function (event, game) {
  
};

